import logo from './logo.svg';
import './App.css';
import NavBar from './components/Header';
import { Counter } from './features/counter/Counter';

function App() {
  return (
    <div className="App">
      <NavBar />
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <Counter />
      </header>
    </div>
  );
}

export default App;
